import React, { Component } from "react";
import { Helmet } from "react-helmet";

class Result extends React.Component {
  render() {
    return (
      <div className="application">
        <Helmet>
          <div style="width:300px; margin:0; padding:0; border:0;">
            <iframe
              src="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300"
              frameborder="0"
              border="0"
              cellspacing="0"
              style="width: 300px; height: 300px; margin: 0; padding: 0; overflow: hidden; border: 0;"
            />
            <div style="font-size: x-small; font-family: Arial, Tahoma, sans-serif; text-align: right; width: 300px;margin:0;padding:0;">
              <a
                style="text-decoration: none; color: #999999;"
                href="http://www.budgetyourtrip.com?r=widget"
                target="_blank"
              >
                Budget Your Trip
              </a>
            </div>
          </div>
        </Helmet>
        ...
      </div>
    );
  }
}

export default Result;
